package com.training.nagarro.ecommerce2.model;

public class Count {

	private int count;

	public Count() {
		super();
		// TODO Auto-generated constructor stub
	}

	public Count(int count) {
		super();
		this.count = count;
	}

	public int getCount() {
		return count;
	}

	public void setCount(int count) {
		this.count = count;
	}

	@Override
	public String toString() {
		return "Count [count=" + count + "]";
	}
	
	
}
